        console.log(e);
    }
}
const clientesSchema = new mongoose.Schema({
    nombre : String,
    apellido1 : String,
    apellido2 : String,
    empresa : String,
    email : String,
    edad : Number,
    tipo : String,
    cursos : Array
});

const Clientes = mongoose.model('clientes', clientesSchema);

